import PizzaList from "./components/pizzaList";
import Layout from "./components/layout";

function Router() {
    const [route, setRoute] = useState("pizzasList");
    return (
        <Layout>
            <PizzaList setRoute={setRoute} />
        </Layout>
    );
}

export default Router;
